import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { socketService } from '../../services/socket';  
import './ChatWindow.css';
import MessageList from './MessageList';

const ChatWindow: React.FC = () => {
  const { userId } = useParams<{ userId: string }>();
  interface Message {
    content: string;
    fullName: string;
    createdAt: string;
  }

  const [messages, setMessages] = useState<Message[]>([]);
  const [newMessage, setNewMessage] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const { receiverId, senderId } = useParams<{ receiverId: string; senderId: string }>();

  useEffect(() => {
    const initializeSocket = async () => {
      const token = localStorage.getItem('token');
      if (token && senderId) {
        try {
          console.log('Initializing WebSocket with token and senderId:', token, senderId);
          await socketService.initializeSocket(token, senderId);
          console.log('WebSocket initialized successfully');
        } catch (error) {
          console.error('Error initializing WebSocket:', error);
        }
      } else {
        console.error('Token or senderId is missing');
      }
    };

    initializeSocket();

    return () => {
      console.log('Cleaning up WebSocket connection...');
      const socket = socketService.getSocket();
      if (socket) {
        socket.off('message');
      }
      socketService.disconnect();
    };
  }, []);

  useEffect(() => {
    const socket = socketService.getSocket();
    if (!socket || !socket.connected) {
      const token = localStorage.getItem('token');
      if (token && senderId && receiverId) {
        console.log('Initializing WebSocket with token and senderId:', token, senderId);
        socketService.initializeSocket(token, senderId);
      }
    }

    return () => {
      socketService.disconnect();
    };
  }, [senderId, receiverId]);

  useEffect(() => {
    // Listen for incoming messages
    socketService.getSocket()?.on('message', (message: string) => {
      setMessages((prevMessages) => [
        ...prevMessages,
        {
          content: message,
          fullName: 'Unknown',
          createdAt: new Date().toISOString(),
        },
      ]);
    });

    return () => {
      // Clean up WebSocket connection on component unmount
      socketService.disconnect();
    };
  }, [userId]);

  useEffect(() => {
    const socket = socketService.getSocket();
    if (socket) {
      socket.on('new_message', (message: any) => {
        console.log('New message received:', message);
        setMessages((prevMessages) => [
          ...prevMessages,
          {
            content: message.content,
            fullName: message.sender.fullName || 'Unknown',
            createdAt: new Date().toISOString(),
          },
        ]);
      });
    }

    return () => {
      if (socket) {
        socket.off('new_message');
      }
    };
  }, []);

  const sendMessage = (e: React.FormEvent) => {
    e.preventDefault();

    if (!newMessage.trim()) {
      console.error('Message content is empty');
      return;
    }

    if (!receiverId || !senderId) {
      console.error('Missing sender or receiver ID');
      return;
    }

    const payload = {
      receiverId,
      senderId,
      content: newMessage,
    };


    const socket = socketService.getSocket();
    if (!socket || !socket.connected) {
      console.error('WebSocket is not connected');
      return;
    }

    socket.emit('send_message', payload, (response: any) => {
      if (response.status === 'success') {
    setMessages((prevMessages) => [
      ...prevMessages,
      {
        content: newMessage,
        fullName: 'You',
        createdAt: new Date().toISOString(),
      },
    ]);
      } else {
        console.error('Failed to send message:', response.message);
      }
    });


    setMessages((prevMessages) => [
      ...prevMessages,
      {
        content: newMessage,
        fullName: 'You',
        createdAt: new Date().toISOString(),
      },
    ]);
    setNewMessage('');
  };

  return (
    <div className="chat-window">
      <div className="chat-header">
        {messages.map((message, index) => (
          <div key={index} className={`message ${message.fullName === 'You' ? 'sent' : 'received'}`}>
            <p>
              <strong>{message.fullName}</strong>: {message.content}
            </p>
            <span className="timestamp">{new Date(message.createdAt).toLocaleTimeString()}</span>
          </div>
        ))}
      </div>

      <form onSubmit={sendMessage} className="send-message-form">
        <input
          type="text"
          value={newMessage}
          onChange={(e) => setNewMessage(e.target.value)}
          placeholder="Type a message..."
          disabled={isLoading}
        />
        <button type="submit" disabled={isLoading} className="send-button">
          {isLoading ? 'Sending...' : 'Send'}
        </button>
      </form>
    </div>
  );
};

export default ChatWindow;
